  -- local variables here
  partOid varchar(32);
  lcpOid  varchar(32);
  i       bigint;
BEGIN
  partOid := NEW.plt_leftOid;
  lcpOid  := NEW.plt_rightOid;
  select count(*)
    into STRICT i
    from plt_rep_characterparam t
   where plt_oid = lcpOid
     and (plt_paramtype = '手动' or t.plt_id = 'CP20100322144157007');
  if (i != 0) then
    --insert into plt_t_rep_trigger(plt_oid,plt_partoid,plt_lcpoid) values(sys_guid(),partOid,lcpoid);
    PERFORM plt_mtxact_cal.caculate_actions_by_part_lc(partOid,
                                               lcpOid,
                                               NEW.plt_paramvalue);
    commit;
  end if;
RETURN NEW;
end
$$;


