  -- local variables here
BEGIN
  if NEW.plt_authority is not null then
    if OLD.plt_authority is null then

      insert into plt_mdl_authorityitem(PLT_OID, PLT_AUTHORITYID, PLT_DISPLAYNAME, PLT_NOTE)
      values (uuid_generate_v4(),
         NEW.plt_authority,
         NEW.plt_displayname,
         NEW.plt_modulename);

    else
      update plt_mdl_authorityitem
         set plt_displayname = NEW.plt_displayname,
             plt_note        = NEW.plt_modulename,
             plt_authorityid = NEW.plt_authority
       where PLT_AUTHORITYID = OLD.plt_authority;



    end if;

  end if;
RETURN NEW;
end
$$;


