--
-- Name: plt_rsc_group; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.plt_rsc_group AS
 SELECT g.plt_oid,
    r.level AS plt_level,
    g.plt_name
   FROM (public.plt_org_group g
     JOIN ( WITH RECURSIVE findallgroup AS (
                 SELECT 1 AS level,
                    plt_org_r_group2group.plt_leftoid,
                    plt_org_r_group2group.plt_rightoid
                   FROM public.plt_org_r_group2group
                UNION ALL
                 SELECT (fa.level + 1),
                    n.plt_leftoid,
                    n.plt_rightoid
                   FROM (public.plt_org_r_group2group n
                     JOIN findallgroup fa ON ((n.plt_rightoid = fa.plt_leftoid)))
                )
         SELECT findallgroup.level,
            findallgroup.plt_leftoid,
            findallgroup.plt_rightoid
           FROM findallgroup) r ON ((r.plt_leftoid = g.plt_oid)))
  ORDER BY r.level, g.plt_name;


ALTER TABLE public.plt_rsc_group OWNER TO postgres;

